import logo from './logo.svg';
import Hero from './components/Hero'
import About from './components/About'
import Work from './components/Work'
import Contact from './components/Contact'
import Navbar from './components/Navbar';
import Socials from "./components/Socials"
import Topography from "./components/Topography"
import './App.css';
import React, {useState, useCallback, useRef,useEffect} from 'react'
import gsap from 'gsap'
import Parallax from 'parallax-js'

function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const sceneEvent = useRef(null);

  useEffect(() =>{
    const parallaxInstance = new Parallax(sceneEvent.current,{
      relativeInput: true,
    })
    parallaxInstance.enable();
    return() => parallaxInstance.disable();
  },[])

  return (
    <div className="App">
      <Navbar state={{ isMenuOpen: [isMenuOpen, setIsMenuOpen] }}/>
      <div id="scene" ref={sceneEvent}>
        <Topography ></Topography>
        <Socials ></Socials>
        <Hero className="hero" ></Hero>
        <About data-depth="0.80" ></About>
      </div>
      <Work></Work>
      <Contact></Contact>
    </div>
  );
}

export default App;
